import express  from "express";
import graphqlHTTP from 'express-graphql';
import schema from "./schema";

console.log('server is on')

const app = express();

//routes
app.get('/', (req, res) => {
    res.json({
        message: 'Hello World!'
    })
});

app.use('/graphql', graphqlHTTP({
    graphiql: true, 
    schema: schema
}));


app.listen(3000, () => console.log('Server on port 3000'));

